const Dirreccion = ()=>{
    const direccion = 'Calle Principal, Número 123, Ciudad, País';
  const enlaceRandom = 'https://ejemplo.com/random'; // Reemplaza con el enlace deseado

  const urlGoogleMaps = `https://www.google.com/maps/place/${encodeURIComponent(direccion)}`;

  return (
    <div>
      <h2>Dirección del Restaurante</h2>
      <p>{direccion}</p>
      <p>
        <a href={enlaceRandom} target="_blank" rel="noopener noreferrer">
          Ir a Página Aleatoria
        </a>
      </p>
      <p>
        <a href={urlGoogleMaps} target="_blank" rel="noopener noreferrer">
          Ver en Google Maps
        </a>
      </p>
    </div>
  );
};
export default Dirreccion
